  false,\n\t\"url\": null,\n\t\"notes\": \" n        The Enterprise Adoption Survey
  (EAS) was a one-time survey commissioned by MCA-Armenia to measure assistance, practices,
  and improvements associated with the Post-Harvest, Processing and Marketing (PPM)
  Subactivity of the Water-to- Market (WtM) Activity of the MCA-Armenia Program. nnThe
  sample frame for the survey was all enterprises, farmer groups, and individuals
  who had received PPM assistance by September 2010.The survey was fielded by a consortium
  of AREG, an Armenia-based NGO, and Jen Consult in 2010/2011, after all survey respondents
  had received PPM assistance. In-person interviews were conducted with respondents
  at their place of business or residence. nnThe survey is designed to elicit a range
  of qualitative and quantitative information. Questions regarding assistance activities
  and practices were generally qualitative and open-ended, whereas questions regarding
  improvements were generally quantitative and multiple-choice.n      \",\n\t\"license_title\":
